import React, { Component } from 'react';
import Navigation from './Navigation';
import savings from '../assets/savings.png';
import '../styles/Savings.css';

const Twitter = require('twitter-v2');

const client = new Twitter({
  consumer_key: '1LmJOyCH71wBjc5dK8yzCU6sS',
  consumer_secret: 'Iu2UDdhVAOkVNMzRQfT4G9D0bU8SskJm1XteWhl5P8hD5NGqXP',
  access_token_key: '723543476-BayWgGbdB94mTOF0qXE4WeOz1HM7XOPDgnXt4nVx',
  access_token_secret: 'qNzU7Z9BPPo5rNe6W3mzvVWrmx1voiPvHeNEKd5hl4H9D',
});

const { data } = await client.get('tweets', { ids: '1228393702244134912' });
console.log(data);


class Savings extends Component {

    render() {
        return (
            <div>
                <Navigation />
                <img id="savings" src={savings} className="pageImg"/>
                <h3 className="pageHeader">SAVINGS</h3>
            </div>
        );
    }
}

export default Savings;
